webpackJsonp([0x681158941041],{7742:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/311920609/" title="Photo Sharing"><img src="https://static.flickr.com/105/311920609_d52e96b258_o.jpg" width="500" height="406" alt="jimknopf" /></a></p>\n<p>We went to see the musical version of <a href="http://tivoli.de/index.php?id=event843">Jim Knopf und Lukas der Lokomotivfuhrer</a> at the Schmidt Theatre in Hamburg yesterday. As you can see, Christopher was very happy to have his picture (a scan of a polaroid) taken with the star. We can highly recommend it.</p>\n<p>As a bonus, here\'s the annual Christmas Cookie Cutter picture.</p>\n<p><a href="http://www.flickr.com/photos/papascott/311931666/" title="Photo Sharing"><img src="https://static.flickr.com/116/311931666_6999e98b23.jpg" width="500" height="375" alt="IMG 1815" /></a></p>',fields:{title:"Jim Knopf and Christopher",date:"02 Dec 2006",url:"https://papascott.de/2006-12-02-jim-knopf-and-christopher/"}}},pathContext:{slug:"/2006-12-02-jim-knopf-and-christopher/",prev:{fields:{title:"Major Medical Breakthrough",date:"01 Dec 2006",slug:"/2006-12-01-major-medical-breakthrough/"}},next:{fields:{title:"No Accident",date:"02 Dec 2006",slug:"/2006-12-02-no-accident/"}}}}}});
